import React from 'react';

export const Login = () => {
    return (
        <div className='min-h-screen flex items-center justify-center'>
            <div className='bg-white drop-shadow-md rounded-md flex w-1/2 p-5'>
                <h6 className='text-center uppercase font-semibold text-lg'>
                    Login
                </h6>
            </div>
        </div>
    );
};
